column3:
"🌲🍊 Two bowls for breakfast to start off every day;
Sour D then Captain C and I’ll be on my way!

Sour Diesel is the dreamy legend that will never lose it's place in the hall of fame. This strain will blow your mind. There is not one thing about this strain that I don't like. It smells so pungent and it's effects are so strong. This is what a sativa is all about. It's hard to find a high quite like Sour D's. I will ..."

