column48:
"🍇🌚 Bong ripped, off we drift on God's Gift;
Time slipped, eyelids getting hard to lift.
This is one amazing strain. Very potent and delicious. It will put everything at ease. It will make you smile. It will sit you down. It will reassure you that everything is okay. It will even make sure you eat! If a strain could be your mother, this would be it! It tastes amazing. Sweet like a berry with a touch of citrus along ..."
